// @ts-check

const { danger, fail, warn, markdown, message } = require('danger');
const { detectNonApprovedDependencies, checkChangelog, checkStorybookVersions } = require('@fluentui/scripts-dangerjs');

/**
 * This trick (of explicitly passing Danger JS utils as function arg, instead of importing them at places where needed)
 * is necessary due to the magic DangerJS is doing with imports: https://spectrum.chat/danger/javascript/danger-js-actually-runs-your-imports-as-globals~0a005b56-31ec-4919-9a28-ced623949d4d
 */
const dangerJS = { danger, fail, warn, markdown, message };

module.exports = async () => {
  await checkChangelog(dangerJS);
  await detectNonApprovedDependencies(dangerJS);
  await checkStorybookVersions(dangerJS);
};

const { getJestProjects } = require('@nx/jest');

export default {
  projects: [...getJestProjects()],
};

// @ts-check

const path = require('path');
const { pathsToModuleNameMapper } = require('ts-jest');

const tsConfig = require('./tsconfig.base.json');

const tsPathAliases = pathsToModuleNameMapper(tsConfig.compilerOptions.paths, {
  prefix: `<rootDir>/${path.relative(process.cwd(), __dirname)}/`,
});

/**
 * @type {import('@jest/types').Config.InitialOptions}
 */
const baseConfig = {
  transform: {
    '^.+\\.ts$': 'ts-jest',
  },
  testMatch: ['**/+(*.)+(spec|test).+(ts|js)?(x)'],
  moduleFileExtensions: ['ts', 'tsx', 'js', 'jsx', 'json'],
  testPathIgnorePatterns: ['/node_modules/', '/lib/', '/lib-commonjs/', '/dist/'],
  testEnvironment: 'jsdom',
  moduleNameMapper: { ...tsPathAliases },
  cacheDirectory: '<rootDir>/node_modules/.cache/jest',
  clearMocks: true,
  watchPlugins: ['jest-watch-typeahead/filename', 'jest-watch-typeahead/testname'],
  // OLD format for migration to jest 29 - TODO: migrate to new format . https://jestjs.io/blog/2022/04/25/jest-28#future
  snapshotFormat: {
    escapeString: true,
    printBasicPrototype: true,
  },
  /**
   *  **Local Machine:**
   *
   * jest is resource greedy. on local machine it will spawn workers into all your CPU threads which will provide additional heat up of your machine and everything else will be blocked.
   * Based on tests on local machine, 50% of CPU threads is the best value for local development ( also the fastest).
   *
   *  **CI:**
   *
   * based on testing not spawning additional workers and rely on task orchestrator (NX) parallelization is fastest on our CI env atm ( 8 Core machine, 16GB RAM)
   */
  maxWorkers: isCI() ? 1 : '50%',
};

module.exports = {
  ...baseConfig,
  /* TODO: Update to latest Jest snapshotFormat
   * By default Nx has kept the older style of Jest Snapshot formats
   * to prevent breaking of any existing tests with snapshots.
   * It's recommend you update to the latest format.
   * You can do this by removing snapshotFormat property
   * and running tests with --update-snapshot flag.
   * Example: "nx affected --targets=test --update-snapshot"
   * More info: https://jestjs.io/docs/upgrading-to-jest29#snapshot-format
   */
  snapshotFormat: { escapeString: true, printBasicPrototype: true },
};

function isCI() {
  return (
    (process.env.CI && process.env.CI !== 'false') ||
    (process.env.TF_BUILD && process.env.TF_BUILD.toLowerCase() === 'true') ||
    process.env.GITHUB_ACTIONS === 'true'
  );
}

// @ts-check

const { prettierSupportedFileExtensionsByContext } = require('@fluentui/scripts-prettier');

const commands = {
  format: 'prettier --write',
  /**
   * Run eslint in fix mode for applicable files followed by prettier.
   * The eslint wrapper handles filtering which files should be linted, since we need to both:
   * - respect ignore files (which eslint doesn't do by default when passed a specific file path)
   * - match the set of files that are linted by the package's normal `lint` command
   */
  lint: 'node ./scripts/lint-staged/src/eslint',
};

const nonJsExtensions = [
  prettierSupportedFileExtensionsByContext.stylesheets,
  prettierSupportedFileExtensionsByContext.markdown,
  prettierSupportedFileExtensionsByContext.others,
].flat();

// https://www.npmjs.com/package/lint-staged
module.exports = {
  [`**/*.{${nonJsExtensions}}`]: [commands.format],
  [`**/*.{${prettierSupportedFileExtensionsByContext.js}}`]: [/* commands.format, */ commands.lint],
};

{
  "migrations": [
    {
      "version": "19.2.4-beta.0",
