// @ts-check
import fs from 'node:fs';
import path from 'node:path';
import webpackBundler from 'monosize-bundler-webpack';
import createAzureStorage from 'monosize-storage-azure';

/** @type {import('monosize').MonoSizeConfig} */
const config = {
  repository: 'https://github.com/microsoft/fluentui',
  storage: createAzureStorage({
    authType: 'AzurePipelinesCredential',
    endpoint: 'https://fluent-bundlesize.azurewebsites.net/api/fluentuilatest',
    tableName: 'fluentuilatest',
  }),
  bundler: webpackBundler(config => {
    return config;
  }),
  reportResolvers: {
    packageName: async packageRoot => {
      const packageJson = await fs.promises.readFile(path.join(packageRoot, 'package.json'), 'utf-8');
      const json = JSON.parse(packageJson);
      return json.name.replace('@fluentui/', '');
    },
  },
};

export default config;

{
  "$schema": "./node_modules/nx/schemas/nx-schema.json",
  "workspaceLayout": {
    "libsDir": "packages",
    "appsDir": "apps"
  },
  "targetDefaults": {
    "bundle-size": {
      "dependsOn": ["build"],
      "cache": true
    },
    "bundle": {
      "cache": true,
      "dependsOn": ["^build"]
    },
    "build": {
      "dependsOn": ["^build"],
      "inputs": ["production", "^production"],
      "cache": true
    },
    "build-storybook": {
      "dependsOn": [],
      "inputs": ["default", "{workspaceRoot}/.storybook/**", "{projectRoot}/.storybook/**"],
      "cache": true
    },
    "generate-api": {
      "dependsOn": ["^generate-api"],
      "cache": true
    },
    "type-check": {
      "dependsOn": ["^build"],
      "cache": true
    },
    "prepare": {
      "dependsOn": ["^prepare"],
      "cache": true
    },
    "test": {
      "dependsOn": [],
      "inputs": ["default", "^production", "{workspaceRoot}/jest.preset.js"],
      "cache": true,
      "options": {
        "passWithNoTests": true
      }
    },
    "test-integration": {
      "dependsOn": ["build", "^build"],
      "cache": true
    },
    "test-ssr": {
      "cache": true
    },
    "test-vr": {
      "dependsOn": ["build-storybook"],
      "cache": true
    },
    "test-perf": {
      "dependsOn": [],
      "cache": true
    },
    "e2e": {
      "dependsOn": [],
      "cache": true,
      "inputs": ["default", "{projectRoot}/cypress.config.ts", "!{projectRoot}/**/?(*.)+cy.[jt]s?(x)?"]
    },
    "lint": {
      "dependsOn": ["build"],
      "cache": true,
      "inputs": [
        "default",
        "{workspaceRoot}/.eslintrc.json",
        "{workspaceRoot}/.eslintignore",
        "{workspaceRoot}/eslint.config.js"
      ],
      "options": {
        "command": "eslint src"
      }
    },
    "format": {
      "executor": "nx:run-commands",
      "options": {
        "command": "prettier --write {projectRoot}"
      },
      "metadata": {
        "help": {
          "command": "yarn prettier --help",
          "options": {}
        }
      },
      "configurations": {
        "check": {
          "command": "prettier --check {projectRoot}"
        }
      }
    },
    "verify-packaging": {
      "dependsOn": ["build"],
      "cache": true
    },
    "@nx/jest:jest": {
      "inputs": ["default", "^production", "{workspaceRoot}/jest.preset.js"],
      "cache": true,
      "options": {
        "passWithNoTests": true
      },
      "configurations": {
        "ci": {
          "ci": true,
          "codeCoverage": true
        }
      }
    }
  },
  "namedInputs": {
    "default": ["{projectRoot}/**/*", "sharedGlobals", "{workspaceRoot}/.github/workflows/pr.yml"],
    "sharedGlobals": [],
    "production": [
      "default",
      "!{projectRoot}/**/?(*.)+(spec|test).[jt]s?(x)?(.snap)",
      "!{projectRoot}/tsconfig.spec.json",
      "!{projectRoot}/jest.config.[jt]s",
      "!{projectRoot}/src/test-setup.[jt]s"
    ]
  },
  "release": {
    "projectsRelationship": "independent",
    "groups": {
      "northstar": {
        "releaseTagPattern": "@fluentui/react-northstar_v{version}",
        "projectsRelationship": "fixed",
        "projects": ["packages/fluentui/*"]
      }
    }
  },
  "parallel": 3,
  "useInferencePlugins": false,
  "defaultBase": "master",
  "plugins": [
    {
      "plugin": "./tools/workspace-plugin/src/plugins/workspace-plugin.ts",
      "options": {
        "testSSR": {
          "exclude": ["react-theme-stories", "react-migration-v8-v9-stories", "react-migration-v0-v9-stories"]
        },
        "verifyPackaging": {
          "include": ["react-text", "react-components"]
        }
      },
      "include": [
        "tools/**/*",
        "scripts/**/*",
        "packages/eslint-plugin/**",
        "packages/tokens/**",
        "packages/react-conformance/**",
        "packages/react-components/**/*"
      ]
    }
  ]
}

// @ts-check

/**
 * https://prettier.io/docs/en/configuration.html
 * @type {import('prettier').Options}
 */
module.exports = {
  printWidth: 120,
  tabWidth: 2,
  singleQuote: true,
  trailingComma: 'all',
  arrowParens: 'avoid',
  overrides: [
    {
      files: 'apps/vr-tests/**/*',
      options: {
        // The smaller printWidth for the storywright tests promotes readability by preventing test cases
        // from being squished onto one line (and squished up against each other in consecutive lines)
        printWidth: 100,
      },
    },
    {
      // These files may be run as-is in IE 11 and must not have ES5-incompatible trailing commas
      files: ['*.html', '*.htm'],
      options: {
        trailingComma: 'es5',
      },
    },
  ],
};

{
  "name": "fluentui-repo",
  "$schema": "node_modules/nx/schemas/project-schema.json",
  "targets": {
    "prepare-local-registry": {
      "command": "node ./tools/workspace-plugin/scripts/install-verdaccio"
    },
    "local-registry": {
      "executor": "@nx/js:verdaccio",
      "options": {
        "port": 4873,
        "config": ".verdaccio/config.yml",
        "storage": "tmp/local-registry/storage"
      },
      "dependsOn": ["prepare-local-registry"]
    }
  }
}

{
  "compilerOptions": {
    "target": "ES2019",
    "module": "ESNext",
    "esModuleInterop": true,
    "sourceMap": true,
    "strict": true,
    "skipLibCheck": true,
    "pretty": true,
    "typeRoots": ["node_modules/@types", "./typings"],
    "rootDir": ".",
    "baseUrl": ".",
    "paths": {
      "@fluentui/web-components": ["packages/web-components/src/index.ts"],
      "@fluentui/tokens": ["packages/tokens/src/index.ts"]
    }
  }
}

{
  "extends": "@tsconfig/node18/tsconfig.json",
  "compilerOptions": {
    "noEmit": true
  },
  "include": ["./apps/*/just.config.ts", "./packages/**/just.config.ts"],
  "files": ["./typings/find-free-port/index.d.ts"]
}
